css:
.git-diff-details-outer {
  background-color: #002b36;
  width: 100%;
}
.git-diff-details-main-panel {
  position: relative;
}
.git-diff-details-button-panel {
  text-align: right;
  padding: 2px;
  width: 100%;
}
.hide-invisibles .invisible-character {
  opacity: 0;
}
.line.git-diff-details-new-highlighted {
  background-color: rgba(162, 232, 120, 0.1) !important;
}
.line.git-diff-details-new-highlighted .invisible-character {
  opacity: 0;
}
.line.git-diff-details-old-highlighted {
  background-color: rgba(232, 120, 120, 0.1) !important;
}
.line.git-diff-details-old-highlighted .invisible-character {
  opacity: 0;
}
.line.git-diff-details-new-flat {
  background-color: rgba(162, 232, 120, 0.7) !important;
  color: black !important;
}
.line.git-diff-details-new-flat span {
  color: black !important;
}
.line.git-diff-details-new-flat .invisible-character {
  opacity: 0;
}
.line.git-diff-details-old-flat {
  background-color: rgba(232, 120, 120, 0.7) !important;
  color: black !important;
}
.line.git-diff-details-old-flat span {
  color: black !important;
}
.line.git-diff-details-old-flat .invisible-character {
  opacity: 0;
}
.highlight.git-diff-details-new-highlighted .region {
  background-color: rgba(162, 232, 120, 0.4);
}
.highlight.git-diff-details-old-highlighted .region {
  background-color: rgba(232, 120, 120, 0.4);
}
.highlight.git-diff-details-new-flat .region {
  background-color: rgba(162, 232, 120, 0.4);
}
.highlight.git-diff-details-old-flat .region {
  background-color: rgba(232, 120, 120, 0.4);
}
